import React, {useState} from 'react';

import {
    Input
} from './styled'

const SearchBarComponent = () => {
    const [term, setTerm] = useState('');
    return (
        <Input 
            onChange={() => setTerm(term)}
            value={term}
            placeholder='Try me'
        />
    )
}

export default SearchBarComponent;
